Description: An Extreme Comixxx Parody!
 A God must fall before a hero may rise - thus is the epic tale of 'Thor XXX: An Extreme Comixxx Parody.' Equipped with his mighty hammer in one hand and his meaty shaft on the other. Thor (Danny Mountain) is a spoiled prince sleeping with every maiden in the realm of Asgard. When Thor goes too far and upsets the balance of peace in the universe, his father, King Odin (Evan Stone) banishes him to Earth. Though stripped of his power, Thor realizes he still has what it takes to please the women of Earth, like sexy scientist Jane (Jenna Presley). When Thor's mischievous brother, Loki (Seth Gamble) threatens to take control of Asgard, the God of Thunder must find strength in his new humanity in order to save everything he loves and become the ruler and lover he is destined to be!
